import React from "react";
import { useNavigate } from "react-router-dom";
import Card from '@mui/material/Card';
import CardMedia from '@mui/material/CardMedia';
import CardContent from '@mui/material/CardContent';
import Typography from '@mui/material/Typography';

const HearthstoneCard = (props) => {
  const { todo } = props;
  const { cardClass, cost, name, rarity, text,id} = todo;
  let history = useNavigate();
  // let url = "https://art.hearthstonejson.com/v1/render/latest/enUS/256x/" +id +".png";
  
  let url = "https://art.hearthstonejson.com/v1/256x/" + id + ".jpg";

  return (
    
    // <div
    //   style={{
    //     backgroundColor: "grey",
    //     margin: "20px",
    //     padding: "15px",
    //     width: "400px"
    //   }}
    <Card
      onClick={() => history.push(`/card/${id}`)}
    >
        <CardMedia
        component="img"
        height="140"
        image= {url}
        alt="green iguana"
      />
        <CardContent>
        <Typography gutterBottom variant="h5" component="div">
          Lizard
        </Typography>
        <Typography variant="body2" color="text.secondary">
          Lizards are a widespread group of squamate reptiles, with over 6,000
          species, ranging across all continents except Antarctica
        </Typography>
      </CardContent>
      {/* <h4 >  {name} </h4> */}
      {/* <h4> class: {cardClass} </h4>
      <h4> cost: {cost} </h4>
      <h4> rarity: {rarity} </h4> */}
      {/* <img src = {url}/> */}
      {/* <h4> text: {text} </h4> */}
      {/* <h6> {`Completed: ${completed}`} </h6> */}
    </Card>
  );
};

export default HearthstoneCard;
